/**
 * @flow
 */

import {StyleSheet} from 'react-native';

export default StyleSheet.create({
  contentContainer: {
    height: 200,
  },
  pageIndicator: {
    position: 'absolute',
    flexDirection: 'row',
    justifyContent: 'space-around',
    alignItems: 'center',
    alignSelf: 'center',
    backgroundColor: 'transparent',
  },
});
